Execution Version SHARED FACILITIES EASEMENT AND LEASE
THIS SHARED FACILITIES EASEMENT AND LEASE (this AGREEMENT) is made as of the 24th day of August 2020 (the Effective Date), between CRESCENT RIDGE, LLC, a Delaware limited liability company (Grantor), and LONE TREE WIND, LLC, a Delaware limited liability company (Grantee). Each of Grantor and Grantee may be referred to herein individually as a Party and collectively, as the Parties. Certain capitalized terms used in this Agreement are defined in Section 23 below.
WITNESSETH:
WHEREAS, Grantor is the owner of that certain parcel of real property described on Exhibit A hereto (the O&M Building Parcel) upon which Grantor owns and maintains certain facilities and improvements in connection with Grantors wind energy generation facility (the Crescent Ridge Project), including an operations and maintenance building and related improvements (the O&M Building);
WHEREAS, Grantor is also the owner of that certain parcel of real property described on Exhibit B hereto (the Substation Parcel) upon which Grantor owns and maintains certain facilities and improvements in connection the Crescent Ridge Project, including a substation and related equipment and improvements (the Substation and, together with the O&M Building, the Facilities);
WHEREAS, Grantor is the owner of that certain parcel of real property described on Exhibit C hereto (the Turbine Maintenance Building Parcel) which is presently vacant land;
WHEREAS, Grantor is the holder of those certain wind leases described on Exhibit D hereto (the Crescent Ridge Leases) which affect the real property described on Exhibit D hereto (the Crescent Ridge Project Area and, together with the O&M Building Parcel, the Substation Parcel, the Turbine Maintenance Building Parcel, the Grantor Property);
WHEREAS, Grantor has the right under the Crescent Ridge Leases to grant easements, licenses and similar rights to one or more persons or entities without the need for the applicable landowners consent;
WHEREAS, Grantee is currently developing an approximately 90 MW wind energy generation project in Bureau County, Illinois (the Lone Tree Wind Project and, together with the Crescent Ridge Project, each a Project and collectively the Projects), and requires the use of and access to the Facilities and the Grantor Property in connection therewith; and
WHEREAS, Grantor desires to grant to Grantee certain rights to access, use and/or occupy the Grantor Property and the Facilities, all subject to and in accordance with the terms of this Agreement.
NOW, THEREFORE, in consideration of the foregoing premises, the mutual agreements herein contained and other good and valuable consideration, the receipt and sufficiency of which are hereby acknowledge, the Parties agree as follows: 1. Recitals. The foregoing recitals are incorporated herein by reference. 2. Grant of Rights. Subject to the terms and conditions of this Agreement: 2.1 Easement. Grantor hereby grants to Grantee, and Grantee accepts from Grantor, a non-exclusive easement over, under, across, on and through (i) the O&M Building Parcel and the O&M Building for the purpose of using and accessing the O&M Building in common with Grantor (including the right to operate and park vehicles on the O&M Building Parcel) and of constructing, maintaining, operating, inspecting, relocating, removal, repairing and replacing one or more utility lines (including fiber optic lines) serving the O&M Building, (ii) the O&M Building Parcel for the purposes of ingress, egress and regress to and from the Turbine Maintenance Building Parcel and of constructing, maintaining, operating, inspecting, relocating, removal, repairing and replacing one or more utility lines (including fiber optic lines) serving the Turbine Maintenance Building Parcel, and (iii) the Substation Parcel and the Substation for the purpose of using and accessing the Substation in common with Grantor, and for the installation, construction, use, operation, maintenance, repair, and modification of facilities as required to connect the electrical output of the Lone Tree Wind Project to the Substation in accordance with (x) the terms of the Interconnection Service Agreement dated as of April 14, 2020 between Grantee, Commonwealth Edison Company and PJM Interconnection, L.L.C. and (y) that certain Interconnection Construction Service Agreement dated as of April 14, 2020 between Grantee, Commonwealth Edison Company and PJM Interconnection, L.L.C. (collectively, the Interconnection Agreement). 2.2 Lease. Grantor hereby leases to Grantee, and Grantee leases from Grantor, the Turbine Maintenance Building Parcel (the Lease). Grantee shall have the right to construct, operate, maintain, repair, replace, relocate and remove one or more buildings, which may include a turbine maintenance building, together with related improvements, fixtures, utilities and parking areas, on the Turbine Maintenance Building Parcel. In consideration of the Lease, Grantee shall pay to Grantor the amount of Twenty-Five Thousand Dollars ($25,000) (the Lease Payment) within thirty (30) days following the Effective Date. The Lease Payment shall constitute full payment by Grantee to Grantor for the Lease for the Term. 2.3 License. Grantor hereby grants to Grantee a non-exclusive license (the License) to use Grantors access roads located within the Crescent Ridge Project Area. The License will be irrevocable during the Term. 3. Term. The term of this Agreement (the Term) shall commence on the Effective Date and shall continue for fifty-five (55) years after the Commercial Operations Date (hereinafter defined). As used herein, Commercial Operations Date means the date that the Lone Tree Wind Project delivers electricity in commercial quantities (excluding test power). Grantor shall not be liable for any delay in reaching substantial completion of the Lone Tree Wind Project, nor shall any such delay affect the validity of this Agreement. Notwithstanding anything herein to the contrary, Grantee shall have the right to terminate this Agreement in 2
whole or in part as to any portion of the Grantor Property upon written notice to Grantor and, in such event, the Parties shall have no further rights or obligations hereunder other that such rights and obligations that expressly survive termination hereof. 4. Shared Expenses. Grantee shall be responsible for, beginning on the Commercial Operations Date and continuing thereafter throughout the Term, Grantees proportional share of the Shared Expenses (as hereinafter defined) which proportional share shall be a fraction, the numerator of which shall be the nameplate capacity of the Lone Tree Wind Project, and the denominator of which shall be the total nameplate capacity of the Lone Tree Wind Project and the Crescent Ridge Project. As of the Commercial Operations Date, Grantees proportional share equals 59.3%. The Shared Expenses include the costs incurred by Grantor to provide the services set forth in Sections 8 and 9 of this Agreement, together with all real estate, property, use, and ad valorem taxes which may be assessed against the O&M Building Parcel, the Substation Parcel, the Turbine Maintenance Building Parcel and the Facilities, it being understood that Grantor shall be responsible for the payment of any such taxes. The Shared Expenses shall be payable by Grantee without offset, reduction or counterclaim as against any amounts owed or claimed to be owed by Grantor to Grantee, whether under this Agreement or otherwise; provided, however, that any amounts paid by Grantee hereunder as Shared Expenses shall be without duplication to any amounts payable by Grantee under that certain Management & Operations Agreement dated as of the date hereof, by and between Grantee and Leeward Asset Management LLC. Grantee shall reimburse Grantor upon request for all real estate, property, use, and ad valorem taxes which may be assessed against any building or other improvements constructed by Grantee on the Turbine Maintenance Building Parcel. 5. Construction of the Facilities. The Grantor has caused the Facilities to be constructed as of the Effective Date and Grantee accepts the Facilities and the Grantor Property as is, without any right of rejection, repair or other refusal of the Facilities or Grantor Property. The forgoing notwithstanding, Grantee may request that the Facilities be expanded or modified, at Grantees expense, in order to accommodate use of the Facilities by the Lone Tree Wind Project, pursuant to plans and specifications to be approved in advance by Grantor, not to be unreasonably withheld or delayed. 6. Payments. Grantee shall invoice Grantor monthly for its proportional share of the Shared Expenses. Grantors invoice shall include a reasonably detailed description of the Shared Expenses and Grantors share of the Shared Expenses and related backup documentation, along with wire transfer instructions for making payment to Grantor. Grantee shall make all payments to Grantor by wire transfer of immediately available funds as provided in Grantors invoice, or by an alternative form of payment mutually agreed to by the Parties, within thirty (30) days of receipt of such invoice. Any amount due and delinquent by Grantee to the Grantor will bear interest at the prime rate of interest as published in the Wall Street Journal on the date nearest to the date of calculation, plus two hundred (200) basis points to cover added administrative costs, from the due date until paid. Grantee shall have the right to audit, upon terms and conditions reasonably agreed by the Parties, and receive supporting documentation for, any expenses or other amounts required to be paid by Grantee under this Agreement. If there is a dispute as to any amount invoiced by Grantor, Grantee shall pay all amounts not in dispute in accordance with this Section 6. Grantor shall pay any disputed amount ultimately determined as payable with interest 3
thereon at the rate set forth in this Section 6, accruing from the date that is thirty (30) days after receipt of Grantors disputed invoice. 7. Use. Grantee shall have the right of access and use of the Grantor Property and Facilities solely in connection with its ownership, construction, testing, commissioning, use, operation, maintenance, repair, modification, and decommissioning of the Lone Tree Wind Project. Grantor and Grantee hereby consent and acknowledge the right of the Grantor and the respective operators of the Crescent Ridge Project and the Lone Tree Wind Project (the Operators) to use and occupy the Grantor Property and Facilities for the purposes of using, operating, maintaining, repairing, replacing, and modifying the Crescent Ridge Project and the Lone Tree Wind Project, as applicable. Grantor and Grantee shall, and each Party shall cause its respective Operator, as applicable, to, comply with the building regulations set forth on Schedule 7 (the Building Regulations) in connection with Grantees use of the O&M Building Parcel and Substation Parcel (but not, however, the Turbine Maintenance Building Parcel). Subject to the foregoing, Grantee and its Operator shall have unencumbered rights to access the Grantor Property and Facilities without first notifying Grantor, so long as such access does not materially hinder, damage or delay operations within the O&M Building Parcel, Substation Parcel and/or Facilities. Grantee will not use or permit any portion of the Grantor Property and Facilities to be used by Grantees Operator for any purpose other than those permitted by this Agreement. 8. Grantors Services. Grantor agrees to furnish to Grantee the following services at the O&M Building: (a) potable hot and cold water; (b) heated and refrigerated air conditioning at comfortable temperatures, as determined by Grantor; (c) access to electrical power; (d) such janitorial and maintenance services (including trash disposal) of the common areas the Facilities ("Common Areas") as the Grantor determines to be reasonably required; (e) a septic tank system or other means the Grantor determines to be reasonably required for sewage treatment for the O&M Building, and (f) electric lighting for Common Areas in the manner and to the extent deemed by the Grantor to be reasonably required. The Grantor will use reasonable diligence to repair any malfunction of the Facilities, but the failure to any extent to furnish, or any stoppage or interruption of, the foregoing services resulting from any cause whatsoever will not render the Grantor liable in any respect for consequential damages to any Grantee or any other person or be construed as an eviction of Grantee, except to the extent such failure was due to the gross negligence or willful misconduct of Grantor. To the extent Grantee requests or requires additional services and the Grantor in its sole discretion agrees to provide such additional services, Grantee agrees to pay to the Grantor such charges as the Grantor might from time to time prescribe for such additional services at Grantors cost. Grantor shall be responsible for obtaining and maintaining applicable federal, state and local permits required for the use and operation of the O&M Building. 9. Grantors Maintenance. Grantor shall maintain, at all times, in good condition the following with respect to the Facilities: 9.1 The structural parts of the building and other improvements in which the Facilities are located which structural parts include the foundations, bearing and exterior walls, subflooring, foundation and roof. 4
9.2 The unexposed electrical, plumbing and sewage systems, including regular maintenance and pumping, if required. 9.3 Window frames, gutters and downspouts on the building and other improvements in which the Facilities are located. Grantor shall promptly, but in any event within a reasonable period of time, repair the Facilities; provided that, to the extent the Facilities are damaged by the grossly negligent acts or omissions of Grantee or its authorized representatives, the costs of such repair shall be at Grantees sole cost and expense. 10. Quiet Enjoyment. The Grantor agrees Grantee will peacefully hold the Grantor Property and Facilities, subject to the rights of the Grantor and its Operator. Notwithstanding any other provisions hereof, Grantor shall have the right without Grantees consent to add to and to modify the size and location of the Facilities and to grant subeasements or other interests in the Grantor Property (other than the Turbine Maintenance Building Parcel) and Facilities to other parties as co-tenants with Grantor and Grantee, provided such additions, modifications, subeasements and/or other interests do not adversely interfere with Grantees rights hereunder. 11. Insurance. 11.1 Grantees Insurance. Throughout the Term, Grantee, at its expense, will maintain (i) commercial general liability insurance with limits of not less than $2,000,000 per occurrence and $4,000,000 aggregate; (ii) excess liability insurance with a limit of not less than $5,000,000 in the aggregate, in each case for injury to any person and for damage to property; and (iii) commercial property insurance, insuring Grantees personal property and equipment on the O&M Building Parcel, Substation Parcel and Facilities for the full replacement cost thereof. Such insurance shall, at the option of Grantor, name Grantor as an additional insured on a primary, non-contributing basis, except for claims arising out of Grantors negligence or willful misconduct and shall cover all risks arising directly or indirectly out of Grantees activities on the Grantor Property and Facilities whether or not caused or contributed to by Grantees negligence. All such policies of insurance shall waive the insurers right of subrogation against Grantor. 11.2 Grantors Insurance. Throughout the Term, Grantor, at its expense, will maintain commercial general liability insurance with limits of not less than $2,000,000 per occurrence and $4,000,000 aggregate; (ii) excess liability insurance with a limit of not less than $5,000,000 in the aggregate, in each case for injury to any person and for damage to property; and (iii) commercial property insurance, in the amount of the replacement cost of Grantors buildings and improvements on the Grantor Property and Facilities. All such policies of insurance shall waive the insurers right of subrogation against Grantee. 12. Alterations; Repairs. Except as otherwise agreed to in writing by Grantor and Grantee, Grantee will make no alterations or additions to the O&M Building Parcel, Substation Parcel and Facilities except for improvements contemplated by the terms of the Interconnection Agreement, this Agreement and the Interconnection Shared Facilities Agreement. Grantee will, 5
at Grantee's expense, reimburse Grantor for the repair or replacement of any damage done to the Grantor Property and Facilities by Grantee or Grantee's agents, employees, licensees or invitees. Grantee will not commit or allow any waste or damage to be committed on any portion of the Grantor Property. Any repairs and permitted alterations or additions to the O&M Building Parcel, Substation Parcel and Facilities may be performed by the Grantor or, with Grantors permission (not to be unreasonably withheld), by Grantee. 13. Assignment. Grantee or the Grantor may assign its interest in this Agreement without consent (upon prior written notification) to, and only to, (a) a party controlling, controlled by or under common control with Grantee or Grantor (an Affiliate), or (b) any party succeeding to all or a portion of Grantee's or Grantor's interest in their respective Projects; provided that such party agrees in writing to be bound by all the terms and conditions of this Agreement, including any obligation of the assigning Party from and after the effective date of such assignment. If the foregoing procedures are complied with, the assigning Party shall be released from any obligations hereunder arising from and after the effective date of such assignment. Any other assignment or transfer will be void. Notwithstanding the foregoing, Grantee or Grantor may, without consent of the other Party, encumber, hypothecate or pledge its interest hereunder to any Holder. 14. Indemnity. Grantee agrees to indemnify and save the Grantor harmless from, all costs incurred in connection with loss of life, bodily or personal injury or property damage arising out of the negligence or willful misconduct of, or violations of, or noncompliance with applicable laws or permits by, Grantee, its agents, employees, licensees or invitees on the Grantor Property and Facilities. Grantor agrees to indemnify and save the Grantee harmless from, all costs incurred in connection with loss of life, bodily or personal injury or property damage arising out of the negligence or willful misconduct of, or violations of, or noncompliance with applicable laws or permits by, Grantor, its agents, employees, licensees or invitees on the Grantor Property and Facilities. The foregoing indemnities shall survive the expiration or earlier termination of this Agreement. 15. Condemnation. If the Grantor Property and Facilities are taken or condemned in whole for any public use or purpose by right of eminent domain (with or without litigation) or is transferred by agreement in connection with or in lieu of or under threat of condemnation, the Term and the interests created hereby will terminate as of the date title vests in the condemnor or transferee. Grantor and Grantee shall be permitted to make such claim against the condemning authority for award, and for such business damages and/or consequential damages as may be allowed by law. 16. Casualty. If the Grantor Property (other than the Turbine Maintenance Building Parcel) and Facilities are damaged by fire or other casualty and, despite Grantors commercially reasonable efforts, such damage cannot be repaired within one hundred eighty (180) days (as such period may be estimated by the Grantor as soon as reasonably practicable after the occurrence of such damage), or such longer period as may be agreed to by Grantor and Grantee, and such damage substantially prevents use of the Grantor Property and Facilities by Grantee as set forth herein, this Agreement, at the option of the Grantee, exercised by giving written notice thereof to Grantor within thirty (30) days after Grantees receipt of written notice from Grantor indicating such damage cannot be repaired within the agreed upon timeframe, will terminate as 6
of the date such notice is given with respect to Grantee. On such termination Grantee will pay any Shared Expenses apportioned to the date on which such damage occurred and will immediately surrender the applicable Grantor Property and Facilities to the Grantor. If the damage can be repaired within one hundred eighty (180) days or if the damage cannot be repaired within one hundred eighty (180) days (or such longer period as agreed to by Grantor and Grantee), but the Grantee has not exercised the option to terminate this Agreement, the Grantor will make the necessary repairs and this Agreement will continue in effect, but the Shared Expenses will be equitably reduced or abated (as determined in the good faith judgment of the Grantor and reasonably agreed upon by Grantee) until such repairs are made, unless such damage is so slight that Grantee's occupancy of the Grantor Property (other than the Turbine Maintenance Building Parcel) and Facilities is not materially interrupted, in which case the Shared Expenses will not be abated or reduced. 17. Entry. The Grantor and the Grantor's agents, employees and contractors, including, but not limited to, its Operator, will have the right to enter the Grantor Property and Facilities at all reasonable hours (or, in any emergency, at any hour), for any purpose as the Grantor may reasonably deem necessary and Grantee will not be entitled to any abatement or reduction of Shared Expenses by reason thereof. 18. Grantee Default. The following events will be deemed to be events of default by Grantee under this Agreement: (a) failure to pay any Shared Expenses or other sums payable by Grantee hereunder when such sums become due after thirty (30) days written notice from Grantor; (b) failure to comply with any material term of this Agreement or the Building Regulations to be observed by Grantee after thirty (30) days written notice from Grantor (or such longer period as may be required by Grantee in the exercise of diligent pursuit of cure); (c) the filing by or against Grantee of any proceeding under the federal bankruptcy act or any similar law which said proceeding has not been dismissed within ninety (90) days of such filing; (d) the adjudication of Grantee as bankrupt or insolvent in proceedings filed under the federal bankruptcy act or any similar law; or (e) the appointment of a receiver or trustee for Grantee or any of the assets of Grantee which said proceeding has not been dismissed within ninety (90) days of said filing. On the occurrence of any event of default, the Grantor may perform or cause to be performed the obligations of Grantee under this Agreement and may enter the Grantor Property and Facilities to accomplish such purpose without being liable to prosecution or any claim for damages therefor. Grantee agrees to reimburse the Grantor on demand for any reasonable and actual expense which the Grantor might incur in effecting compliance with this Agreement on behalf of Grantee, and Grantee further agrees that, except as otherwise provided herein, the Grantor will not be liable for any damages resulting to Grantee from such action, whether caused by the negligence of the Grantor or otherwise. 19. (a) Remedies for Grantee Default. The Grantor's acceptance of Shared Expenses following the occurrence of an uncured event of default will not be construed as the Grantor's waiver of such event of default. No waiver by the Grantor of any default by Grantee will be deemed to constitute a waiver of any other or future default hereunder. Forbearance by the Grantor to enforce one or more of the remedies herein provided will not be deemed to constitute a waiver of any default. No provision of this Agreement will be deemed to have been 7
waived by the Grantor or Grantee unless such waiver is in writing signed by the Grantor or Grantee. (b) Breach by Grantor. Grantor shall be in breach of this Agreement if (a) Grantor fails within thirty (30) days after receipt in writing by Grantor and any Holder whose name and address shall have been furnished by Grantee for such purpose, of notice from Grantee specifying therein that a material obligation of Grantor has not been performed; provided, however, that if the nature of Grantor's obligation is such that more than thirty (30) days are reasonably required for its performance, then Grantor shall not be in breach if performance is commenced within such thirty (30) day period and thereafter diligently pursued to completion; (b) the filing by or against Grantor of any proceeding under the federal bankruptcy act or any similar law which said proceeding has not been dismissed within ninety (90) days of such filing; (c) the adjudication of Grantor as bankrupt or insolvent in proceedings filed under the federal bankruptcy act or any similar law; or (d) the appointment of a receiver or trustee for Grantor or any of the assets of Grantor which said proceeding has not been dismissed within ninety (90) days of said filing. If Grantor shall be in breach of this Agreement, Grantee shall have such rights as are available at law or equity, including, without limitation, specific performance and the right to cure any defaults by Grantor under the Crescent Ridge Leases, and Grantor further agrees that, except as otherwise provided herein, Grantee will not be liable for any damages resulting to Grantor from such action, whether caused by the negligence of Grantee or otherwise. 20. Force Majeure. Notwithstanding any other provision of this Agreement, each Partys obligations under this Agreement shall be suspended by any Force Majeure if and to the extent that such Party is prevented or delayed from performing by reason of the Force Majeure; provided, however, that (a) the prevention or delay of performance shall be of no greater scope and of no longer duration than is reasonably caused by the Force Majeure and required by any remedial measures, (b) no obligations of either Party that were required to be performed before the occurrence of such causes shall be excused as the result of the occurrence, and (c) each Party shall use reasonable commercial efforts to remedy its inability to perform; provided, further, that no Force Majeure shall excuse any payment obligations due hereunder. If the performance by a Party of its obligations under this Agreement is affected by any Force Majeure, such Party shall as soon as practicable notify the other Party of the nature and extent thereof. 21. Financing Cooperation. Each Party (a "Responding Party") agrees to execute and deliver from time to time within twenty (20) days after written request from any the Party (the "Requesting Party") (a) a customary consent to collateral assignment in the form requested by any collateral assignee and reasonably acceptable to the Responding Party and (b) any customary and reasonable estoppels which might reasonably be required by the Requesting Party connection with any tax equity financing, in each case, at the Requesting Partys cost and expense. 22. Hazardous Materials. Neither Party shall not cause or permit any Hazardous Material to be brought upon, kept or used in or about the Grantor Property and Facilities by such Party, its agents, employees, contractors or invitees other than in compliance with applicable law. If contamination of the Grantor Property or Facilities by Hazardous Material occurs for which a Party is legally liable to the other Party for damage resulting therefrom, then such Party shall indemnify, defend and hold the other Party harmless from any and all claims, judgments, damages, penalties, fines, costs, liabilities or losses which arise during or after the Term as a 8
result of such contamination. The foregoing indemnification includes, without limitation, costs incurred in connection with any investigation of site conditions or any clean-up, remedial, removal or restoration work required by any federal, state or local governmental agency or political subdivision because of Hazardous Material present in the soil or ground water on or under the Grantor Property and Facilities. Without limiting the foregoing, if the presence of any Hazardous Material on the Grantor Property and Facilities caused or permitted by a Party results in any contamination of the Grantor Property and Facilities, such Party shall promptly take all actions at its sole expense as are necessary to return the Grantor Property and Facilities to the condition existing prior to the introduction of any such Hazardous Material to the Grantor Property and Facilities; provided, that, if Grantee is the indemnifying Party, the Grantor's approval of such actions shall first be obtained, which approval shall not be unreasonably withheld so long as such actions would not potentially have any material adverse long-term or short-term effect on the Grantor Property and Facilities. The foregoing indemnities shall survive the expiration or earlier termination of this Agreement. 23. Definitions. The terms used in this Agreement have the meanings indicated: 23.1 Encumbrance(s). All mortgages, deeds of trust, security agreements, collateral assignments and other charges or liens and all ground leases, easements and other covenants, conditions or restrictions which presently affect the Grantor's interest or any part thereof in this Agreement, the Grantor Property and Facilities, or any other property associated therewith and all advancements thereunder and all increases, renewals, modifications, consolidations, replacements and extensions thereof. 23.2 Force Majeure. Acts of God or any other casualty or occurrence, condition, event or circumstance of any kind or nature not reasonably within the affected Partys control and which could not have been avoided by reasonable measures by the affected Party, including strikes, slow-downs or labor difficulties, fires, flood, earthquakes, explosions, natural disasters, or other hazards, equipment failure where such equipment has been maintained in accordance with Good Utility Practices, acts of public enemies, riots, civil commotions, insurrection, or war. Force Majeure expressly does not include: any delay in performing or failure of performance of any contractual provision by a Party (except to the extent caused by a Force Majeure event); late delivery or breakage of equipment or materials (except to the extent caused by a Force Majeure event); or economic hardship. 23.3 Hazardous Material. Any hazardous or toxic substance, material or waste, including, but not limited to, those substances, materials, and wastes listed in the United States Department of Transportation Hazardous Materials Table (49 CFR 172.101) or by the Environmental Protection Agency as hazardous substances (40 CFR Part 302) and amendment thereto, or such substances, materials and wastes that are or become regulated under any applicable local, state or federal law 23.4 Holder. The mortgagee, beneficiary, secured party or lessor under any Encumbrance and such party's successors and assigns. 9
23.5 Operator. The person or persons described in Section 7 of this Agreement providing operation and maintenance services to Grantor or Grantee. 23.6 Shared Expenses. The sums to be paid by Grantee to the Grantor pursuant to the terms of this Agreement, as defined in Section 4 and further described on Schedule 25.6 of this Agreement. 23.7 Interconnection Shared Facilities Agreement. The Shared Facilities Agreement, dated on or about the date hereof, by and between Grantor and Grantee, with respect to certain shared interconnection facilities, as the same may be amended from time to time. 24. Miscellaneous. The Grantor and Grantee further agree as follows: 24.1 Brokerage. The Grantor warrants to Grantee and Grantee warrants to the Grantor that it has had no dealings with any broker in connection with the execution of this Agreement and each agrees to indemnify and hold the other harmless from all claims for commissions or other compensation asserted by any person with respect to this Agreement. 24.2 License Subject to Lease Terms. The Grantees use and occupancy of the Crescent Ridge Project Area is subject to the terms and conditions of the Crescent Ridge Leases. 24.3 Recording. The Grantor and Grantee agree that this Agreement will not be recorded, but that a memorandum hereof in form and substance mutually acceptable to the Parties will be executed and delivered within ten (10) days after the written request of either Party, which memorandum may be recorded in Bureau County, Illinois. 24.4 Notices. Any notice or communication required or permitted to be given by any provision of this Agreement must be in writing and will be deemed to have been given when delivered personally, or on the first (1st) Business Day following the day sent by nationally-recognized overnight courier, directed to the following addressees or to such other or additional addressees as any party might designate by written notice to the other parties: If to the Grantor: Crescent Ridge, LLC c/o Leeward Renewable Energy Development, LLC Attn: Legal Department 6688 N. Central Expressway, Suite 500 Dallas, Texas 75206
If to Grantee: Lone Tree Wind, LLC c/o Leeward Renewable Energy Development, LLC 10
