If notices or other communications are required in this Agreement to be given within a specified period and the end of such period falls on other than a Business Day, such period shall be extended to the next Business Day. As used in this Agreement, "Business Day" shall mean any day other than a Saturday, Sunday, or holiday upon which national banks in Chicago, Illinois, are closed for the conduct of business. 24.5 Entire Agreement. Grantee agrees that there are no representations, understandings, stipulations, agreements or promises pertaining to this Agreement or the Grantor Property and Facilities which are not incorporated herein, except as set forth in the Interconnection Shared Facilities Agreement. This Agreement will not be altered, waived, amended or extended, except by a written agreement signed by the Grantor and Grantee. 24.6 Severability. If any clause or provision of this Agreement is illegal, invalid or unenforceable under any present or future law, the remainder of this Agreement will not be affected thereby. It is the intention of the Parties that if any provision is held to be illegal, invalid or unenforceable, there will be added in lieu thereof a provision as similar in terms to such provision as is possible and be legal, valid and enforceable. 24.7 Binding Effect. The provisions of this Agreement will be binding on and inure to the benefit of the Grantor and Grantee and their respective heirs, personal representatives, successors and permitted assigns. 24.8 Governing Law. This Agreement will be construed and enforced according to the internal laws of the State of Illinois. All claims, disputes and other matters in question arising out of or relating to this Agreement, or the breach thereof, will be decided by proceedings instituted and litigated in a court of competent jurisdiction in the State of Illinois. IN ADDITION, EACH PARTY HEREBY WAIVES, TO THE FULLEST EXTENT PERMITTED BY APPLICABLE LAW, ANY RIGHT IT MAY HAVE TO A TRIAL BY JURY IN RESPECT OF ANY LITIGATION DIRECTLY OR INDIRECTLY ARISING OUT OF, UNDER OR IN CONNECTION WITH THIS AGREEMENT. 24.9 Costs and Attorneys Fees. In the event litigation is commenced for the interpretation or enforcement of this Agreement, the prevailing Party in such litigation shall be entitled to recover its costs and reasonable attorneys fees. 24.10 Cumulative Remedies. No remedy or election hereunder shall be deemed exclusive but shall, wherever possible, be cumulative with all other remedies at law or in equity and the exercise of one or more rights or remedies will not prejudice the concurrent or subsequent exercise of other rights or remedies. 11
24.11 Covenants and Conditions; Construction of Agreement. All provisions of this Agreement to be observed or performed by Grantor and the Grantee are both covenants and conditions. In construing this Agreement, all headings and titles are for the convenience of the Parties only and shall not be considered a part of this Agreement. Whenever required by the context, the singular shall include the plural and vice versa. This Agreement shall not be construed as if prepared by one of the Parties, but rather according to its fair meaning as a whole, as if both of the Parties had prepared it. 24.12 Counterparts. This Agreement may be executed in counterparts, each of which shall be deemed an original and all of which when taken together shall constitute one and the same document. 24.13 Time is of the Essence. Time is of the essence of the performance of all obligations to be performed or observed by the Parties under this Agreement.
