SCHEDULE 7 Building Regulations 1. Access. The entrances, lobbies, passages, corridors, elevators, stairways and other Common Areas will not be encumbered or obstructed by Grantee or its agents, employees or invitees or be used for any purpose other than for access to the applicable Grantor Property and Facilities. 2. Building Hours. The Grantor from time to time will establish and provide Grantee with a schedule of business hours for the Facilities as approved by Grantee; provided however Grantee shall have access to the Grantor Property and Facilities at all times. The Grantor reserves the right to exclude from the Grantor Property and Facilities during non- business hours all persons not authorized in writing, by pass or otherwise, to have access to the Grantor Property and Facilities. Grantee will be responsible for all persons authorized by Grantee to have access to the Grantor Property and Facilities and will be liable to the Grantor for all acts of such persons while in the Grantor Property and Facilities. The Grantor may require all persons given access to the Grantor Property and Facilities during non- business hours to sign a register on entering and leaving the Grantor Property and Facilities. During the continuance of any public disturbance, the Grantor may prevent all access to the Grantor Property and Facilities. The failure to establish or enforce any of the foregoing requirements will not impose any liability on the Grantor to Grantee for the removal of any property from the Grantor Property and Facilities or otherwise. The Grantor will not be liable to Grantee or other person except for the Grantor's gross negligence or willful misconduct for damages or loss arising from the admission, exclusion or rejection of any person to or from the Grantor Property and Facilities. 3. Care. Grantee will not mark, paint, drill into or in any way deface any part of the Facilities. No boring, cutting or stringing of wires will be permitted except with the prior written consent of the Grantor and as the Grantor might direct. Grantee will not install any tile or other similar floor covering without the prior written consent of the Grantor. Grantee will refer all contractors, representatives and installation technicians rendering any service to Grantee to the Grantor for the Grantor's supervision, approval and control before the performance of any such service. 4. Dangerous Substances. Neither Grantee nor its agents, employees or invitees will at any time bring or keep on the Grantor Property and Facilities any flammable, combustible or explosive fluid, chemical or substance, except for customary cleaning and maintenance substances. No acids, vapors or other damaging materials will be discharged into the waste lines, vents or flues of the Grantor Property and Facilities. 5. Equipment. Grantee agrees to limit the use of electric current to the capacity of existing feeders, risers and wiring installation. 6. Locks. The Grantor will provide all locks in the Grantor Property and Facilities and no additional locks or bolts of any kind will be placed on any door or window by Grantee, nor will any changes be made in existing locks or the mechanism thereof without the prior 46
written consent of the Grantor. A reasonable number of keys to such locks will be furnished by the Grantor to any Operator of Grantee, and Grantee will not permit any duplicate keys to be made by any person other than the Grantor. Grantee will, on the termination of this Agreement, return to the Grantor all keys furnished to Grantee's Operator, if any. 7. Plumbing. The water closets and other plumbing fixtures will not be used for any purpose other than that for which they were constructed, and no improper substances will be thrown therein. All damages resulting from the misuse of any plumbing fixture by Grantee, its agents, employees or invitees will be borne by Grantee. 8. Prohibited Use. No space in the Grantor Property and Facilities will be used for any illegal purpose. Grantee will not occupy or permit any portion of the Grantor Property and Facilities to be occupied for any purpose or in any manner which is contrary to any zoning, building code or other law or regulation governing the Grantor Property and Facilities. 9. Services. Unless expressly permitted by the Grantor, no person will be employed by any Grantee to perform janitorial or maintenance services on the Grantor Property and Facilities. Grantee and its agents, employees and invitees will cooperate with the Grantor in keeping the Grantor Property and Facilities neat and clean. 10. Confidentiality. Grantee and Grantor shall comply with all confidentiality requirements relating to use of the Facilities and Grantor Property as reasonably determined by Grantor.
